members.member:
Acepta la caratula de validacion
En base a los parametros que se le envian se acepta la caratula de validacion Sample request: POST api/contracts/AcceptCover { "parametroCont": "int", "parametroUsr": "int", "parametroAut": "int", "parametroExtra": "int", "parametroVuelta": "int", "nombreAutorizador": "string", "tipoAutorizador": "int", "existeAutorizadores_Aut": true }
Cadena con mensaje de confirmacion /// AcceptCoverSetResponse Si no tiene autorización Error interno del servidor no hay datos

Rechaza la caratula de validación
En base a los parametros que se le envian se rechaza la caratula de validacion agregando un motivo a los comentarios Sample request: POST api/contracts/RejectCover { "motivo": "string", "parametroCont": "int", "parametroUsr": "int", "parametroAut": "int", "parametroExtra": "int", "parametroVuelta": "int", "nombreAutorizador": "string", "tipoAutorizador": "int", "existeAutorizadores_Aut": true }
Cadena con mensaje de confirmacion /// RejectCoverSetResponse Si no tiene autorización Error interno del servidor no hay datos

